import MainContainer from './components/MainContainer';
import { Route, Router, Routes } from 'react-router-dom'
function App() {
  return (
    <>
    <Router>
<Routes>
  <Route path="/" element={<MainContainer/>} />
</Routes>
    <MainContainer/>
    </Router>
    </>
  );
}

export default App;
